import React, { useState, useRef, useEffect } from 'react';
import { 
  Typography, Box, Avatar, ThemeProvider, createTheme, 
  CssBaseline, Container, Paper
} from '@mui/material';
import SendIcon from '@mui/icons-material/Send';
import PsychologyIcon from '@mui/icons-material/Psychology';
import PersonIcon from '@mui/icons-material/Person';
import ReactMarkdown from 'react-markdown';
import axios from 'axios';
import './App.css';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: { main: '#007aff' },
    background: {
      default: '#f2f2f7',
      paper: '#ffffff',
    },
  },
  typography: {
    fontFamily: '-apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif',
    fontSize: 16,
  },
  shape: { borderRadius: 20 },
  components: {
    MuiButton: {
      styleOverrides: {
        root: { boxShadow: 'none', '&:hover': { boxShadow: 'none' } },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: { boxShadow: 'none', backgroundColor: '#ffffff' },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            backgroundColor: '#f2f2f7',
            '& fieldset': { borderColor: '#ccc' },
            '&:hover fieldset': { borderColor: '#aaa' },
            '&.Mui-focused fieldset': { borderColor: '#007aff' },
          },
        },
      },
    },
  },
});

const App = () => {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const messagesEndRef = useRef(null);

  const getGreeting = () => {
    const hour = new Date().getHours();
    if (hour < 12) return 'Good Morning';
    if (hour < 18) return 'Good Afternoon';
    return 'Good Evening';
  };

  useEffect(() => {
    setMessages([{
      id: Date.now(),
      text: `${getGreeting()}! How can I help you today?`,
      sender: 'bot',
      timestamp: new Date().toLocaleTimeString()
    }]);
  }, []);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: 'smooth' });
  };

  useEffect(() => { scrollToBottom(); }, [messages]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!input.trim()) return;

    const userMessage = {
      id: Date.now(),
      text: input.trim(),
      sender: 'user',
      timestamp: new Date().toLocaleTimeString(),
    };

    setMessages(prev => [...prev, userMessage]);
    setInput('');
    setError(null);
    setIsLoading(true);

    try {
      const response = await axios.post('http://localhost:5000/api/chat', {
        message: userMessage.text,
        max_length: 100,
        temperature: 0.7
      });

      const botMessage = {
        id: Date.now() + 1,
        text: response.data.response,
        sender: 'bot',
        timestamp: new Date().toLocaleTimeString(),
        processingTime: response.data.processing_time
      };

      setMessages(prev => [...prev, botMessage]);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to get response from the bot');
      console.error('Chat error:', err);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className="app-container">
        <Container className="chat-container">
          <Box className="messages-container">
            {messages.map((message) => (
              <Paper
                key={message.id}
                className={`message-wrapper ${message.sender}-message`}
                elevation={0}
              >
                <div className="message-content">
                  <Avatar>
                    {message.sender === 'bot' ? <PsychologyIcon /> : <PersonIcon />}
                  </Avatar>
                  <div>
                    <Typography variant="body1">
                      <ReactMarkdown>{message.text}</ReactMarkdown>
                    </Typography>
                    <Typography variant="caption" className="message-time">
                      {message.timestamp}
                    </Typography>
                  </div>
                </div>
              </Paper>
            ))}
            {isLoading && (
              <div className="message-wrapper bot-message">
                <div className="message-content">
                  <Avatar>
                    <PsychologyIcon />
                  </Avatar>
                  <div>Typing...</div>
                </div>
              </div>
            )}
            <div ref={messagesEndRef} />
          </Box>
          <Box className="input-container">
            <form onSubmit={handleSubmit}>
              <input
                type="text"
                value={input}
                onChange={(e) => setInput(e.target.value)}
                placeholder="iMessage"
                disabled={isLoading}
              />
              <button type="submit" className="send-button" disabled={isLoading || !input.trim()}>
                <SendIcon />
              </button>
            </form>
          </Box>
        </Container>
      </div>
    </ThemeProvider>
  );
};

export default App;
